function detailUserDialog(el) {
    var data = $(el).data('detail');
    $('.clear').val('');
    $('#md-User-detail').modal('show');

				$('#Detail-User-AccessFailedCount').val(data.accessFailedCount);
				$('#Detail-User-Active').prop('checked', data.active);
				$('#Detail-User-ExpiredPassword').val(data.expiredPassword);
				$('#Detail-User-ExpiredUser').val(data.expiredUser);
				$('#Detail-User-Fullname').val(data.fullname);
				$('#Detail-User-IsLockout').prop('checked', data.isLockout);
				$('#Detail-User-LastChangePassword').val(data.lastChangePassword);
				$('#Detail-User-LastLogin').val(data.lastLogin);
				$('#Detail-User-Mail').val(data.mail);
				$('#Detail-User-Password').val(data.password);
				$('#Detail-User-PhoneNumber').val(data.phoneNumber);
				$('#Detail-User-PhotoUrl').val(data.photoUrl);
				$('#Detail-User-Token').val(data.token);
				$('#Detail-User-Username').val(data.username);

}
